/*Table structure for table `logistics_order` */

DROP TABLE IF EXISTS `logistics_order`;

CREATE TABLE `logistics_order` (
  `logistics_order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '运单id',
  `logistics_order_code` varchar(255) NOT NULL COMMENT '运单编号',
  `old_order_code` varchar(255) NOT NULL COMMENT '原订单编号',
  `send_status` tinyint(4) NOT NULL COMMENT '派单状态 0：未派单1：已派单',
  `send_method` tinyint(4) NOT NULL COMMENT '派单方式 1:自动派单  2:手动派单',
  `logistics_order_status` tinyint(4) NOT NULL COMMENT '运单状态 0:初始状态 1：揽货 2：配送 3：送达 4:取消 ',
  `need_pay` float DEFAULT NULL COMMENT '还需支付金额(应收)',
  `need_pay_receive` float DEFAULT NULL COMMENT '实际支付的金额（收货人）(实收)',
  `order_estimated_picking_time` datetime DEFAULT NULL COMMENT '预计取货时间',
  `order_estimated_arrived_time` datetime DEFAULT NULL COMMENT '订单预计到达时间',
  `order_payment_method` tinyint(4) DEFAULT NULL COMMENT '支付方式（原来订单付款方式，小哥app使用字段）',
  `order_payment_status` tinyint(4) DEFAULT NULL COMMENT '支付状态',
  `order_payment_method_actual` tinyint(4) DEFAULT NULL COMMENT '实际支付方式 1:现金 2:支付宝当面付',
  `order_payment_status_actual` tinyint(4) DEFAULT NULL COMMENT '实际支付状态',
  `actual_pay` float DEFAULT NULL COMMENT '配送员实际支付的金额',
  `order_price` float NOT NULL COMMENT '订单价格',
  `order_has_pay` float(7,2) DEFAULT NULL COMMENT '订单已支付',
  `order_delivery_cost` float(7,2) DEFAULT NULL COMMENT '运费金额',
  `receiver_id` tinyint(4) DEFAULT NULL COMMENT '收货人ID',
  `receiver_city_code` varchar(10) DEFAULT NULL COMMENT '收货城市code',
  `logistics_info` varchar(225) DEFAULT NULL COMMENT '给小哥的备注信息',
  `in_price` float NOT NULL COMMENT '配送员需要垫付的金额',
  `goods_count` tinyint(4) DEFAULT NULL COMMENT '商品总件数',
  `goods_weight` float DEFAULT NULL COMMENT '商品重量',
  `receiver_province` varchar(255) DEFAULT NULL COMMENT '收货省份',
  `receiver_city` varchar(255) DEFAULT NULL COMMENT '收货城市',
  `receiver_county` varchar(255) DEFAULT NULL COMMENT '收获区、县',
  `receiver_street` varchar(255) DEFAULT NULL COMMENT '收货街道',
  `receiver_address` varchar(255) DEFAULT NULL COMMENT '收货详细地址',
  `receiver_mobile` varchar(255) DEFAULT NULL COMMENT '收货人手机号',
  `receiver_phone` varchar(255) DEFAULT NULL COMMENT '收货人电话',
  `goods_receiver` varchar(255) DEFAULT NULL COMMENT '运单收货人姓名',
  `user_remark` varchar(255) DEFAULT NULL COMMENT '用户备注',
  `shop_id` int(11) DEFAULT NULL COMMENT '商家id',
  `shop_name` varchar(255) DEFAULT NULL COMMENT '商家名称',
  `shop_mobile` varchar(200) DEFAULT NULL COMMENT '商家电话',
  `shop_type` smallint(3) DEFAULT NULL COMMENT '商家类型 0：签约商家 1：代购商家 2：直购商家 4:转单商家',
  `shop_address` varchar(255) DEFAULT NULL COMMENT '商家地址',
  `delivery_area_code` varchar(20) DEFAULT NULL COMMENT '商家物流区域',
  `delivery_station_code` varchar(20) DEFAULT NULL COMMENT '商家物流点id',
  `shop_lng` double NOT NULL COMMENT '商家经度',
  `shop_lat` double NOT NULL COMMENT '商家纬度',
  `receive_lng` double NOT NULL COMMENT '收货地址经度',
  `receive_lat` double NOT NULL COMMENT '收货地址纬度',
  `distance` double DEFAULT NULL COMMENT '运输距离(单位:米)',
  `order_source` tinyint(3) DEFAULT NULL COMMENT '订单来源 1：自动生成单 2:运单中心派单',
  `balance_member_status` tinyint(3) DEFAULT NULL COMMENT '小哥结算状态 0:未结算  1:已结算',
  `dm_work_number` int(11) DEFAULT NULL COMMENT '接单小哥工号',
  `dm_phone` varchar(50) DEFAULT NULL COMMENT '接单小哥电话',
  `dm_name` varchar(50) DEFAULT NULL COMMENT '接点小哥名称',
  `controlled_time` datetime DEFAULT NULL COMMENT '调度完成时间',
  `getting_time` datetime DEFAULT NULL COMMENT '揽货开始时间',
  `shipping_time` datetime DEFAULT NULL COMMENT '配送开始时间',
  `arrived_time` datetime DEFAULT NULL COMMENT '送达时间',
  `require_pick_up_time` datetime DEFAULT NULL COMMENT '要求取货时间',
  `require_arrived_time` datetime DEFAULT NULL COMMENT '要求送达时间',
  `company_key` tinyint(4) NOT NULL COMMENT '订单所属公司标志(0:零号线)',
  `carry_order` tinyint(4) DEFAULT NULL COMMENT '是否含有随心搭（0：否 1：是）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_id` int(10) NOT NULL COMMENT '创建人',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `last_update_id` int(10) NOT NULL COMMENT '更新人',
  `is_deleted` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否物理删除 0 ：否 1：是',
  `data_version` int(11) NOT NULL COMMENT '版本号',
  PRIMARY KEY (`logistics_order_id`),
  UNIQUE KEY `NewIndex1` (`logistics_order_code`),
  KEY `NewIndex2` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='物流订单表';

