/*Table structure for table `logistics_order_balance_line0` */

DROP TABLE IF EXISTS `logistics_order_balance_line0`;

CREATE TABLE `logistics_order_balance_line0` (
  `balance_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `station_id` int(11) NOT NULL,
  `city_id` tinyint(3) NOT NULL,
  `balanced_account` float NOT NULL COMMENT '结算金额',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_id` int(11) NOT NULL DEFAULT '0' COMMENT '创建ID , 也就是操作人',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `last_update_id` int(11) NOT NULL DEFAULT '0' COMMENT '最后更新ID',
  `is_deleted` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否删除0：否 1：是',
  `data_version` int(11) NOT NULL DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`balance_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='零号线结算流水';

