/*Table structure for table `logistics_order_balance_member` */

DROP TABLE IF EXISTS `logistics_order_balance_member`;

CREATE TABLE `logistics_order_balance_member` (
  `balance_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id 主键',
  `dm_work_number` int(11) NOT NULL COMMENT '小哥工号',
  `logistics_order_id` int(11) NOT NULL COMMENT '结算对应的订单id',
  `balanced_account` float NOT NULL COMMENT '此次结算的金额',
  `balanced_station_id` int(11) NOT NULL,
  `station_balance_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '站点和公司的结算状态  0:未结算  1:已结算',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_id` int(11) NOT NULL COMMENT '创建ID',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `last_update_id` int(11) NOT NULL COMMENT '最后更新ID',
  `is_deleted` tinyint(3) NOT NULL COMMENT '是否删除0：否 1：是',
  `data_version` int(11) NOT NULL DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`balance_id`)
) ENGINE=InnoDB AUTO_INCREMENT=145 DEFAULT CHARSET=utf8 COMMENT='小哥结算流水表';

