/*Table structure for table `logistics_order_goods` */

DROP TABLE IF EXISTS `logistics_order_goods`;

CREATE TABLE `logistics_order_goods` (
  `goods_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品Id',
  `shop_id` int(11) DEFAULT NULL COMMENT '所属商家',
  `order_id` int(11) NOT NULL COMMENT '运单id',
  `order_code` varchar(50) NOT NULL COMMENT '运单编号',
  `old_order_code` varchar(50) NOT NULL COMMENT '原订单编号',
  `goods_name` varchar(250) NOT NULL COMMENT '商品名称',
  `goods_price` float NOT NULL COMMENT '商品价格',
  `goods_amount` tinyint(4) NOT NULL COMMENT '商品数量',
  `goods_weight` float DEFAULT NULL COMMENT '商品重量',
  `in_price` float DEFAULT NULL COMMENT '配送员需要垫付金额',
  `carry_goods` tinyint(4) DEFAULT NULL COMMENT '是否随心搭（0：否 1：是）',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_id` int(11) DEFAULT NULL COMMENT '创建人',
  `last_update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `last_update_id` int(11) DEFAULT NULL COMMENT '更新人',
  `is_deleted` tinyint(3) DEFAULT NULL COMMENT '是否物理删除 0 ：否 1：是',
  `data_version` int(11) NOT NULL DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`goods_id`),
  KEY `NewIndex1` (`order_code`)
) ENGINE=InnoDB AUTO_INCREMENT=252 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='订单商品明细表';

