/*Table structure for table `logistics_order_status` */

DROP TABLE IF EXISTS `logistics_order_status`;

CREATE TABLE `logistics_order_status` (
  `logistics_order_status_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `logistics_order_id` int(11) NOT NULL COMMENT '运单编码',
  `logistics_order_status_code` tinyint(3) NOT NULL COMMENT '运单状态 0:初始状态 1：揽货 2：配送 3：送达 4:取消 ',
  `logistics_order_status_time` datetime NOT NULL COMMENT '变更时间',
  `dm_mobile` varchar(20) NOT NULL COMMENT '小哥手机',
  `dm_name` varchar(30) NOT NULL COMMENT '小哥名称',
  `dm_work_number` int(11) NOT NULL COMMENT '小哥工号',
  `dm_lat` double DEFAULT NULL COMMENT '小哥纬度',
  `dm_lng` double DEFAULT NULL COMMENT '小哥经度',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `create_id` int(11) NOT NULL COMMENT '创建ID',
  `last_update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后更新时间',
  `last_update_id` int(11) NOT NULL COMMENT '最后更新ID',
  `is_deleted` tinyint(3) NOT NULL COMMENT '是否删除0：否 1：是',
  `data_version` smallint(6) NOT NULL DEFAULT '0' COMMENT '版本号',
  PRIMARY KEY (`logistics_order_status_id`),
  KEY `NewIndex1` (`logistics_order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='订单状态改变流水表';

