/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(100) DEFAULT NULL COMMENT '实际姓名',
  `user_name` varchar(100) NOT NULL COMMENT '用户名',
  `mobile` varchar(16) NOT NULL COMMENT '用户手机号',
  `role_id` int(11) NOT NULL COMMENT '角色id',
  `user_password` varchar(100) DEFAULT NULL COMMENT '密码',
  `city_id` tinyint(3) DEFAULT NULL COMMENT '用户所在城市',
  `station_id` int(11) DEFAULT NULL COMMENT '用户所在站点',
  `create_id` int(11) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_id` int(11) NOT NULL DEFAULT '0' COMMENT '更新人',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` smallint(6) NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='物流用户表(不包含小哥)';

